import React,  { useEffect, useState } from 'react'
import {Link} from 'react-router-dom'
import './studentsignup.css'
import Header from '/Users/shreyaprasad/Desktop/Coding /WebDev /planner/client/src/components/common/heading/Header.jsx'

const StudentSignup = () => {

    const [fnameReg, setfnameReg] = useState('')
    const [lnameReg, setlnameReg] = useState('')
    const [srnReg, setsrnReg] = useState('')
    const [emailReg, setemailReg] = useState('')
    const [passReg, setpassReg] = useState('')
    const [repassReg, setrepassReg] = useState('')

    return (
        <div>
            <Header/>
            <div className='signup-flex-container'>
                <div>
                    <h2>Student Signup</h2>
                    <p>Hey there! Are you new to ClubHub? <br></br>Register here to stay updated<br></br>on all student club events</p>
                    <form className='signup-form'>
                        <input type='checkbox'/>
                        <label>Remember me</label><br></br>
                        <button type='submit' class='signup-submit-btn'>SIGNUP</button>
                    </form>
                </div>

                <form className='signup-form-right'>
                        <input 
                            type='text' placeholder='First Name' requried
                            onChange={(e) => {
                                setfnameReg(e.target.value)
                            }}
                        /><br></br><br></br>
                        <input 
                            type='text' placeholder='Last Name' requried
                            onChange={(e) => {
                                setlnameReg(e.target.value)
                            }}
                        /><br></br><br></br>
                        <input 
                            type='text' placeholder='SRN' requried
                            onChange={(e) => {
                                setsrnReg(e.target.value)
                            }}
                        /><br></br><br></br>
                        <input type='email' placeholder='Email ID' requried
                            onChange={(e) => {
                                setemailReg(e.target.value)
                            }}
                        /><br></br><br></br>
                        <input 
                            type='text' placeholder='Enter password' requried
                            onChange={(e) => {
                                setpassReg(e.target.value)
                            }}    
                        /><br></br><br></br>
                        <input 
                            type='text' placeholder='Re-enter password' requried
                            onChange={(e) => {
                                setrepassReg(e.target.value)
                            }}
                        /><br></br><br></br><br></br>
                </form>
            </div>
        </div>
    )
}

export default StudentSignup
